import React from "react";
// import { Link } from "react-router-dom";
import { NavLink } from "react-router-dom";

function Menu() {
    return(
        <>
            <NavLink
                className={({isActive}) => (isActive ? 'active__class' : null)}
                to='/'>
                About us 
            </NavLink>
            <NavLink
                className={({isActive}) => (isActive ? 'active__class' : null)}
                to='/contact'>
                Contact
            </NavLink>

        </>
    )
}

export default Menu;
